import React from 'react';
import './App.css';
import Header from './components/Header/Header'
import PrivateRoute from "./components/PrivateRoute";
import {Route, Switch} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Header/>
      <Switch>
          <PrivateRoute path='/categories' component={Header}/>
          <PrivateRoute path='/articles' component={Header}/>

          <Route path='/login' render={() => {
              return (
                  <div>Here will be the login form</div>
              )
          }}/>
          <Route path='/' render={() => {
              return (
                  <div>Home page</div>
              )
          }}/>
      </Switch>
    </div>
  );
}

export default App;
